package dto;

public class AdminStatistics {
	private float Korea;
	private float NorthofAmerica;
	private float China;
	private float Japan;
	private float France;
	private float Canada;
	
	public AdminStatistics() {
		// TODO Auto-generated constructor stub
	}

	public float getKorea() {
		return Korea;
	}

	public void setKorea(float korea) {
		Korea = korea;
	}

	public float getNorthofAmerica() {
		return NorthofAmerica;
	}

	public void setNorthofAmerica(float northofAmerica) {
		NorthofAmerica = northofAmerica;
	}

	public float getChina() {
		return China;
	}

	public void setChina(float china) {
		China = china;
	}

	public float getJapan() {
		return Japan;
	}

	public void setJapan(float japan) {
		Japan = japan;
	}

	public float getFrance() {
		return France;
	}

	public void setFrance(float france) {
		France = france;
	}

	public float getCanada() {
		return Canada;
	}

	public void setCanada(float canada) {
		Canada = canada;
	}
	
	
}
